import React from 'react'
import './ShopByEra.css'
import ShopByera from '../../Assets/ShopByEra.png';
import ShopByEra1 from '../Components/Assets/ShopByEra1.png';
import ShopByEra2 from '../Components/Assets/ShopByEra2.png';
import ShopByEra3 from '../Components/Assets/ShopByEra3.png';
import ShopByEra4 from '../Components/Assets/ShopByEra4.png';
import ShopByEra5 from '../Components/Assets/ShopByEra5.png';
import ShopByEra6 from '../Components/Assets/ShopByEra6.png';



const ShopByEra = () => {
  return (
    <div className='shop-by-era'>
      <img src={ShopByera}/>
      <div className="shop-era-cat">
            {[ShopByEra1, ShopByEra2, ShopByEra3, ShopByEra4, ShopByEra5, ShopByEra6].map((image, index) => (
                <div key={index} className="shop-eras">
                    <img src={image} className="shop-era-img" alt={`ShopByCat${index + 1}`} />
                </div>
            ))}
      </div>
    </div>
  )
}

export default ShopByEra
